import React from 'react'
import { NavLink } from 'react-router-dom'

const Home = () => {
    return (
        <>
        <h1>Welcome to Andrew's Test App!</h1>
        <NavLink to="/login" exact>Log In</NavLink>
        </>
    )
}

export default Home
